import React from 'react'
import ToDo from './ToDo'

const ToDoList = (toDoes) => {
    if (toDoes[0] !== undefined) {
  return (
    <ul>
        {toDoes.map((Todo) => (
            <ToDo 
            key={Todo.todo_id}
            Todo={Todo}/>
        ))}
        <h1>{toDoes[0].todo_id}</h1>
    </ul>
  )
}
}

export default ToDoList
